import React from "react";
import * as S from "./Card.styled";

const Card = () => {
  return (
    <S.Container>
      <S.Img />
      <S.Text>모집 중</S.Text>
      <S.Text>우리집 댕댕이가 새끼를 낳..</S.Text>
      <S.Text fontSize="18px" margin='14px '>댕댕이 집사</S.Text>
    </S.Container>
  );
};

export default Card;
